INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3001100, "ヤマト", 2.1, 1, 130011, 3001, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 2, 100, -416.5, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか");
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3001101, "ヤマト", 5.68, 4, 130011, 3001, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 2, 101, -416.5, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか");
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3001102, "ヤマト", 0.0, 1, 130011, 3001, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 1, 102, -416.5, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。");
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3002100, "フブキ", 0.0, 1, 130211, 3002, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 1, 100, -416.5, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？");
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3002101, "フブキ", 0.0, 1, 130211, 3002, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 1, 101, -416.5, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡");
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3002102, "フブキ", 8.53, 5, 130211, 3002, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 2, 102, -416.5, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ");
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3002103, "フブキ", 5.67, 7, 130211, 3002, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 1, 103, -416.5, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？");
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3002104, "フブキ", 0.0, 1, 130211, 3002, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 1, 104, -416.5, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？");
