INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3002400, "フブキ", 0.0, 7, 130211, 3005, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 7, 301, -416.5, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡");
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3003200, "フブキ", 4.4, 2, 130211, 3003, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 1, 200, -416.5, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪");
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3003201, "フブキ", 0.0, 7, 130211, 3003, "2030/01/01 14:59:59", "2024/10/31 12:00:00", 0.0, 7, 201, -416.5, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ");
